import Activity from './activity.js'



class Extracurricular extends React.Component {

    render() {
        return (
            <div className="extracurriculars">
                <div className="extraTitle">Leadership Initiatives</div>
                <Activity />
            </div>

        );

    }

}

export default Extracurricular;
